import React from 'react';
import { Link } from 'react-router-dom';
import './App.css'; // Import your CSS file
import busImage from './images/busOne.jpg'; // Import or specify the path to your background image

function Gallery() {
  const backgroundStyle = {
    backgroundImage: `url(${busImage})`,
    backgroundSize: 'cover',
    backgroundRepeat: 'no-repeat',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    justifyContent: 'center',
    color: 'white',
    textAlign: 'center',
  };

  const contentStyle = {
    backgroundColor: 'rgba(0, 0, 0, 0.7)',
    padding: '20px',
    borderRadius: '10px',
  };

  return (
    <div style={backgroundStyle} className="background-section">
      <div style={contentStyle}>
        <h1>Welcome to UW Bus Buddies - Connecting Commuters!</h1>
        <p>Join us to find your commuting buddy.</p>
        <h2>Who We Are</h2>
        <p>We are...</p>
        <h2>Join Us</h2>
        <Link to="/signin">
          <button className="btn btn-primary">Sign In</button>
        </Link>
      </div>
    </div>
  );
}

export default Gallery;
